    Vegetation Mapping Program. The program is being administered by the Biological
    Resources Division (BRD) of the United States Geological Survey (USGS). The USGS/BRD
    is responsible for overall management and oversight of all ongoing mapping efforts.
    This mapping effort was performed by the US Bureau of Reclamation's (USBR) Remote
    Sensing and GIS Group, Technical Service Center, Denver, CO. The vegetation mapping
    program is part of a larger Inventory and Monitoring (I&M) program started by the
